Seems to happen with any enum in the same crate, e.g.

``` rust
enum MyOption<T> {
    MySome(T),
    MyNone,
}

fn main() {
    match MySome(()) {
        MySome { x } => (),
        _ => (),
    }
}
```

If I use `std::option::Option` instead I get the appropriate error message:

```
error: `Some` does not name a structure
```
